def lengthOfLongestSubstring(s):
        """
        :type s: str
        :rtype: int
        """


        def shulie(a1, an, n):
            if n != 1:
                d = (an - a1) / (n-1)
            
                # print(type(n))
                res = []
                for i in range(int(n)):
                    res.append(int(a1 + i * d))
            
                return res
            else:
                return [a1]
        # the above has no problems 

        def all_diff(chars, tag_len):
            """
            chars: the whole list
            tag_len: the target length
            """
            resu = 1
            shulie1 = shulie(0, len(chars) - tag_len, len(chars) - tag_len + 1)
            for i in shulie1:
                sublst = chars[i:(i+tag_len)]
                if len(sublst) == len(set(sublst)):
                    resu = tag_len
                    break
            
            return resu
        
        
        def maxi(a, b):
            if a >= b:
                return a
            else:
                return b

        maxres = 0
        for j in shulie(1, len(s), len(s)):
            print('j = ',j)
            maxres = maxi(all_diff(s, j), maxres)
            print('maxres = ', maxres)
        
        return maxres



